import React from "react";

function Follow() {
  return (
    <div className="main-container">
      <div>
        <div>
          <img className="profile-image" src={profilePic} alt="Profile" />
        </div>
        <div>
          <div className="username">{user}</div>
        </div>
      </div>

      <div>third</div>
    </div>
  );
}

export default Follow;
